public void setUpJava() {
  String javaHome = System.getProperty("java.home");
  assertThat(javaHome)
      .as("java.home is not null")
      .isNotNull();

  String java = isWindows() ? "java.exe" : "java";
  javaBin = Paths.get(javaHome, "bin", java);
  assertThat(javaBin)
      .as("JAVA_HOME/bin/" + java + " exists")
      .exists();
}

